import React, { useState, useEffect } from 'react';

const WorkerSignup = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    password: '',
    workSpecification: '',
    experience: '',
    location: '',
    photo: '',
    latitude: null,
    longitude: null,
  });

  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Get user's location on component mount
  useEffect(() => {
    if (navigator.geolocation) {
      navigator.geolocation.getCurrentPosition(
        (position) => {
          setFormData((prev) => ({
            ...prev,
            latitude: position.coords.latitude,
            longitude: position.coords.longitude,
          }));
        },
        (err) => {
          console.error('Error getting location:', err);
          setError('Could not get your location');
        }
      );
    } else {
      setError('Geolocation is not supported by your browser');
    }
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    // Basic validation
    if (!formData.name || !formData.email || !formData.password) {
      setError('Name, email, and password are required');
      return;
    }

    try {
      const res = await fetch('http://localhost:5000/api/workers/signup', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      const data = await res.json();
      if (!res.ok) {
        setError(data.message || 'Signup failed');
      } else {
        setSuccess('Signup successful! You can now log in.');
        setFormData({
          name: '',
          email: '',
          password: '',
          workSpecification: '',
          experience: '',
          location: '',
          photo: '',
          latitude: formData.latitude,
          longitude: formData.longitude,
        });
      }
    } catch (err) {
      setError('Server error: ' + err.message);
    }
  };

  return (
    <div style={{ maxWidth: '400px', margin: 'auto' }}>
      <h2>Worker Signup</h2>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      {success && <p style={{ color: 'green' }}>{success}</p>}

      <form onSubmit={handleSubmit}>
        <input
          name="name"
          type="text"
          placeholder="Full Name"
          value={formData.name}
          onChange={handleChange}
          required
          style={{ width: '100%', marginBottom: '10px' }}
        />
        <input
          name="email"
          type="email"
          placeholder="Email"
          value={formData.email}
          onChange={handleChange}
          required
          style={{ width: '100%', marginBottom: '10px' }}
        />
        <input
          name="password"
          type="password"
          placeholder="Password"
          value={formData.password}
          onChange={handleChange}
          required
          style={{ width: '100%', marginBottom: '10px' }}
        />
        <input
          name="workSpecification"
          type="text"
          placeholder="Work Specification"
          value={formData.workSpecification}
          onChange={handleChange}
          style={{ width: '100%', marginBottom: '10px' }}
        />
        <input
          name="experience"
          type="number"
          placeholder="Experience (years)"
          value={formData.experience}
          onChange={handleChange}
          style={{ width: '100%', marginBottom: '10px' }}
        />
        <input
          name="location"
          type="text"
          placeholder="Location (e.g. city)"
          value={formData.location}
          onChange={handleChange}
          style={{ width: '100%', marginBottom: '10px' }}
        />
        <input
          name="photo"
          type="text"
          placeholder="Photo URL"
          value={formData.photo}
          onChange={handleChange}
          style={{ width: '100%', marginBottom: '10px' }}
        />

        <button type="submit" style={{ width: '100%' }}>
          Sign Up
        </button>
      </form>

      <p style={{ marginTop: '10px', fontSize: '0.9rem' }}>
        Your current latitude: {formData.latitude || 'Fetching...'} <br />
        Your current longitude: {formData.longitude || 'Fetching...'}
      </p>
    </div>
  );
};

export default WorkerSignup;
